import React from "react"
import { CardContent, Typography, Box } from "@material-ui/core"
import { CircularProgress } from "@mui/material"

export default async function FormSuccess({ props }) {
	const { data } = await props
	console.log(data)
	return (
		<CardContent>
			<Typography>
				{data ? (
					<>
						Congratulations {data.firstName} {data.lasstName}
					</>
				) : (
					<CircularProgress />
				)}
			</Typography>
		</CardContent>
	)
}
